            width: 100%;
        }
    }
    .strategyContainer {
        display: flex;
        flex-direction: row;
        gap: 2rem;
        padding: 3rem 3rem;
        @media screen and (max-width: 1000px) {
            & {
                flex-direction: column;
                padding: 3rem 0rem;

            }
        }
        .strategy {
            width: 100%;
            display: flex;
            gap: 2rem;
            flex-direction: column;
