                    background-color: var(--white);
                    color: var(--black);
                    transition: 0.5s;
                    min-height: 15px;
                    font-size: 1.2rem;
                    &:hover {
                        background-color: var(--red);
                        color: var(--white);
                    }
                }
            }
        }
